import React, { useEffect, useState } from 'react';
import { Helmet, HelmetProvider } from 'react-helmet-async';
import Axios from 'axios';

import { Container, Row, Col, Pagination } from 'react-bootstrap';
import CardSpiceIn from '../Components/SpiceIN/CardSpiceIn';


function SpiceIN() {

    const [spiceInList, setSpiceInList] = useState([]);

    const items =[1,2,3,4,5]

    useEffect(() => {
        Axios.get(`${process.env.REACT_APP_SERVER_DOMAIN}/spicein/list`)
            .then((response) => {
                setSpiceInList(response.data);
            });
    }, []);

  return (
    <div>
        <HelmetProvider>
                <Helmet>
                    <title>Partners | Zom-IN</title>
                </Helmet>
            </HelmetProvider>

            <Container fluid className=" h-100 searchbox">
            <Row className="py-3 px-5">
                search here
            </Row>
            </Container>

            <Container>
                <Row>
                    <Col sm={10}>
                        <Row xs={1} sm={1} md={3} lg={4} className="g-1 py-5">

                        {spiceInList

                        .slice (0,3)

                        .map ((spiceINDetails, key) => {
                            const spiceID = spiceINDetails.id;
                            const category = spiceINDetails.category_spice;
                            const title = spiceINDetails.title_spice;
                            const spiceImg = spiceINDetails.img_title_spice;



                            return (
                                <CardSpiceIn 
                                    key={spiceID}
                                    category={category}
                                    title={title}
                                    spiceImg={spiceImg}
                                />
                            )
                        })
                        }

                        <Pagination size="sm">{items}</Pagination>
                        </Row>
                        </Col>
                        <Col sm={2}>
                            <h1>ads</h1>
                        </Col>
                        </Row>
                        </Container>
    </div>
  )
}

export default SpiceIN
